import React from 'react';
import './Sidebar.css';
import '../SideDrawer/HamburgerToggleButton'
import HamburgerToggleButton from '../SideDrawer/HamburgerToggleButton';

const Sidebar = props => (
  <header className="sidebar">
    <nav className="sidebar__navigation">
      <div><HamburgerToggleButton></HamburgerToggleButton></div>
      <div className="sidebar__logo"><a href="/">The Logo</a></div>
      <div className="spacer"></div>
      <div className="sidebar_navigation_items">
        <ul>
          <li><a href="/">About</a></li>
          {/* Replace with react router links later*/}
          <li><a href="/">Contact</a></li>
        </ul>
      </div>
    </nav>
  </header>
)

export default Sidebar;
